import {React, useState} from "react";

import styled from "styled-components";

const StyleBurger = styled.div `
    width: 2rem;
    height: 2rem;
    position: fixed;
    top: 15px;
    left: 20px;
    display: flex;
    justify-content: space-around;
    flex-flow: column nowrap;


    div {
        width: 2rem;
        height: 0.25 rem;
        background-color: ${({open}) => open ? 'white' : '#333'};
        border-radius: 10px;
    }

`;

const Burger = ( ) => {
    const [open, setOpen] = useState(false)


    return (<StyleBurger open = {open} onClick={() => setOpen(!open)}> 
        <div/>
        <div/>
        <div/>


    </StyleBurger>)

}

export default Burger
